import "./widgetBlock3.css";

export const WidgetBlock3 = () => {
  return (
    <div className="widgetContainer3">
      <img src="\img\Group 2740 (1).svg" alt="img" className="widgetImg3" />
      <span className="widgetTitle3">Korisnika koji su imali transakcije</span>
      <span className="widgetNum3">46</span>
      <span className="widgetStat3">+2 ove sedmice</span>
    </div>
  );
};
